import "./App.css";
import tereTulemast from "./components/tereTulemast";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {
  return (
    <div>
      <Router>
        <Routes>
          <Route path="/" element={<tereTulemast />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
